import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import Playvideo from "./PlayVideo";
import { useDispatch } from "react-redux";
import { addToWatchLater } from "../utils/WatchLater";
// AIzaSyBlYe34vwc3hPZowkVOraACn0cFdjob1Ys
// AIzaSyC4sMaiAoC9FyPx8OTiujn-y1ENTRr07h4
// AIzaSyBTGD1SP06pjn-vwFdBGD6GyryK-GN8ueA44
// AIzaSyD9_oqVRgZNYYPWowokhrksnDMfQyrmTig
const APIKEY = "AIzaSyALHt-CMEvAYETSqyySVOgbDu-3I5pdVj4"
const channelid = "UCeVMnSShP_Iviwkknt83cww";
const fetchurl = `https://www.googleapis.com/youtube/v3/search?key=${APIKEY}&channelId=${channelid}&part=snippet,id&order=date&maxResults=15`;

const YoutubeVideo = () => {
  const [allvideos, setallvideos] = useState([]);
  const [dropdownStates, setDropdownStates] = useState([]);
  const [data, setData] = useState([]);
  const [inputvalue, setinputValue] = useState("");

  useEffect(() => {
    const storedData = JSON.parse(localStorage.getItem("playlists")) || [];
    setData(storedData);
  }, []);

  const handleInputChange = (e) => {
    setinputValue(e.target.value);
  };

  const handleFormSubmit = (e) => {
    e.preventDefault();
    const newPlaylist = { Playlist: inputvalue, id: Date.now(), videos: [] };
    setData((prevData) => [...prevData, newPlaylist]);
    setinputValue("");
    const storedData = JSON.parse(localStorage.getItem("playlists")) || [];
    localStorage.setItem(
      "playlists",
      JSON.stringify([...storedData, newPlaylist])
    );
  };

  useEffect(() => {
    fetch(fetchurl)
      .then((response) => response.json())
      .then((resJson) => {
        const result = resJson.items.map((doc) => ({
          ...doc,
          Videolink: "https://www.youtube.com/embed/" + doc?.id?.videoId,
        }));
        setallvideos(result);
        setDropdownStates(Array(result.length).fill(false)); // Initialize states for each video
      });
  }, []);

  const toggleDropdown = (index) => {
    setDropdownStates((prevStates) => {
      const newStates = [...prevStates];
      newStates[index] = !newStates[index];
      return newStates;
    });
  };
  const dispatch = useDispatch()

const add = () => {
    dispatch(addToWatchLater("onkar"))
}

console.log(allvideos);


  return (
    <>
      <div className="flex h-52 justify-center gap-8  mt-16 flex-wrap ">
        {allvideos.map((item, index) => (
          <div key={item.id} className="w-96 border-2"> 
          <Link to={"/Videoid/" + item.id.videoId}>
          <div key={index} >
            {/* <iframe className="w-full rounded-2xl h-60" src={item.Videolink} key={item.id}></iframe> */}
            <img   className="w-full rounded-2xl h-60" src={item?.snippet?.thumbnails?.high?.url}></img>
            <p className=" ">{item.snippet.title}</p>
            <p>{item.snippet.channelTitle}</p>
              </div>
              </Link>
            <div className="relative inline-block text-left">
              <button
                type="button"
                onClick={() => toggleDropdown(index)}
                className="inline-flex items-center px-4 py-2 border border-gray-300 rounded-md bg-gray-100 text-sm font-medium text-gray-700 hover:bg-gray-200 focus:outline-none focus:ring focus:border-blue-300"
              >
                Save
                <svg
                  className="-mr-1 ml-2 h-5 w-5"
                  xmlns="http://www.w3.org/2000/svg"
                  viewBox="0 0 20 20"
                  fill="currentColor"
                >
                  <path
                    fillRule="evenodd"
                    d="M10 12l-1 1-4-4 1-1.5L10 9l4-4 1 1z"
                    clipRule="evenodd"
                  />
                </svg>
              </button>
              {dropdownStates[index] && (

                <div className="origin-top-right absolute right-0 mt-2 w-52 rounded-md shadow-lg bg-white ring-1 ring-black ring-opacity-5">
                  <button className="bg-gray-300 w-full p-2" onClick={() => add()}>Watch later</button>
                  <div>
                    <ul>
                      {data.map((item) => (
                        <div className="" key={item.id}>
                          <Link to={"/playlist/" + item.id}>
                            <button className="p-2 text-white bg-gray-800 mt-2 w-full" key={item.id}>
                            {item.Playlist}
                            </button>
                          </Link>
                        </div>
                      ))}
                    </ul>
                  </div>

                  {data.length === 0 ? (
                    <div className="mt-10 flex">
                        <input
                          className="w-40 border-0"
                          placeholder="+...Create New Playlist"
                          type="text"
                          value={inputvalue}
                          onChange={handleInputChange}
                        ></input>
                        <button
                          className="bg-green-400"
                          onClick={handleFormSubmit}
                        >
                          Create
                        </button>
                    </div>
                  ) : (
                    <div className="mt-8">  
                        Create New Playlist :
                        <input
                          className="w-40"
                          type="text"
                          value={inputvalue}
                          onChange={handleInputChange}
                        ></input>
                        <button
                          className="bg-green-400"
                          onClick={handleFormSubmit}
                        >
                          Create
                        </button>
                    </div>
                  )}

                  {/* </div> */}
                </div>
              )}
            </div>

          </div>
        ))}
      </div>
    </>
  );
};

export default YoutubeVideo;
